import React from "react";
import { isValidNumber, parsePhoneNumber } from 'libphonenumber-js';
export function getBigString(){
    const strVal =  "This is a string  string";
    return strVal;
}

export function getSmallString(){
    return "Short Strings";
}

export function isValidPhoneNumber(number){
    try {
      let _validatedNumber = parsePhoneNumber(number, "IN");
      return isValidNumber(_validatedNumber.nationalNumber, _validatedNumber.country);
    } catch (Exception) {
      return false;
    }
}


